INSERT INTO `echron_tb_features` (`id`, `name`, `defination`, `green`, `orange`, `red`, `created_at`, `updated_at`) VALUES
(1, 'copayoutnetcats', 'Most health insurance policies have a network of hospitals where you can get treatment. But if you choose a hospital outside this network, insurers charge a co-payment under which you have to pay a part of the bill yourself but the rules vary. Some policies apply it only to specific treatments, while others have a flat percentage for all out of network claims. In some cases, you might even have to pay first and get reimbursed later.', 'Perfect: No copayment, meaning the insurance covers the full amount for the treatment in Non-network hospitals.', 'Be cautious: You will need to pay part of the bill yourself, which can add up to a significant amount for costly treatments and may unexpectedly strain your budget.', 'High financial risk: A substantial portion of the bill will come out of your pocket for every claim at a non-network hospital. This can lead to significant financial strain, especially for expensive treatments.', '2025-03-20 13:54:10', '2025-03-20 13:54:10'),
(2, 'ambucovercats', 'Ambulance cover is a basic yet very important feature in health insurance that pays for emergency transportation to the hospital', 'Sufficient Cover (as per market standards): Your policy covers the sufficient cost of ambulance services during emergencies, ensuring you don’t have to worry about transportation expenses when you need immediate medical care.', 'Lesser: Your policy provides partial coverage for ambulance services, but you might need to pay a part of the cost yourself, especially for longer distances or specific types of ambulances.', 'Below Par: Your policy offers minimal or no ambulance coverage, meaning you may have to bear most or all of the costs for ambulance transportation in case of an emergency', '2025-03-20 13:54:10', '2025-03-20 13:54:10'),
(3, 'airabmucats', 'Air ambulance cover is for emergency medical transportation by air when a patient needs urgent care that isn’t accessible by road.', 'Strength: Your policy provides good coverage for air ambulance services, ensuring timely treatment at the right medical facility without a major financial burden.', 'Lesser: Your policy covers air ambulance transport but with restrictions, such as a capped amount or high co-pay. You may need to bear some out-of-pocket expenses.', 'Below Par: Your policy either does not cover air ambulance services or offers very limited coverage. You may have to pay most or all of the costs, which can be extremely expensive.', '2025-03-20 13:54:10', '2025-03-20 13:54:10'),
(4, 'anuprevheacheupcovcats', 'Do you know, that most people don’t use the free health check-ups included in their insurance? It’s there, it’s useful, but it goes unnoticed. Because if there’s no obvious illness, we assume we don’t need a check-up. What we forget here is a regular health check-up can help you catch potential health issues before they become serious and expensive problems. But, a full-body check-up is not cheap. From blood tests to heart screenings, a proper assessment costs thousands. So, if your insurance already covers it, why not use it? These check-ups typically include blood sugar tests, cholesterol screenings, liver and kidney function tests, ECGs, and more, but mostly there is a varying coverage amount in every policy.\r\n', 'Strength: Your policy covers preventive health check-ups, allowing you to get regular tests without extra costs. This helps in early detection of health issues and keeps you healthy.', 'Lesser: Your policy covers preventive health check-ups but may have certain limits, such as a capped amount, coverage only once in a few years, or eligibility only during a claim-free period.', 'Below Par: Your policy either does not cover preventive health check-ups or offers very limited coverage. You may have to pay entirely for regular screenings, which could make early detection of health issues costly.', '2025-03-20 13:54:10', '2025-03-20 13:54:10'),
(5, 'barisurgcats', 'Losing weight isn’t always as simple as diet and exercise. For some, severe obesity can lead to life-threatening health issues like diabetes, heart disease, and joint problems. Bariatric surgery is a medical procedure designed to help people who struggle with extreme obesity by making changes to their digestive system. It’s a life-altering decision that requires medical guidance, lifestyle changes, and long-term commitment. A common misconception among people is that they can get bariatric surgery done and the insurer will pay for it because it is covered in the policy but, the truth is the insurer covers these surgeries only when medically necessary and recommended by a doctor. If you\'re considering it, make sure to check if your policy covers it, as not all do and if they do there is a coverage limit in most of the cases.', 'Strength: Your policy provides good coverage for bariatric treatment, covering a significant portion of the costs. This reduces your financial burden and makes the procedure more affordable.', 'Lesser: Your policy covers bariatric treatment but with restrictions like a capped amount, strict eligibility criteria, or high co-pay. You may need to bear some out-of-pocket expenses.', 'Below Par: Your policy either does not cover bariatric treatment or offers very limited coverage. You may have to pay most or all of the costs, leading to a significant financial burden.', '2025-03-20 13:54:10', '2025-03-20 13:54:10'),
(6, 'copayseniagecats', 'As people age, healthcare costs rise, and with that many insurers add a co-payment clause for senior citizens under which the insured person has to pay a percentage of their hospital bill. It usually starts at 10-20% and increases with age, making treatments expensive even with insurance. But, the co-payment terms differ across policies. Some policies apply it only after a certain age, while some don’t have any at all.', 'Full Coverage: The insurance company covers 100% of the hospital bill. You don’t need to pay anything out of pocket.', 'High Financial Risk: You’ll pay up to 30% of the hospital bill, which can lead to significant out-of-pocket expenses, especially for expensive treatments.', 'Heavy Burden: A large portion of the hospital bill will need to be paid by you, which could strain your finances for major medical treatments.', '2025-03-20 13:54:10', '2025-03-20 13:54:10'),
(7, 'copaytrehighzoncats', 'Metro cities usually have higher medical expenses than smaller towns. If your policy is issued for a lower-cost zone but you choose treatment in a high-cost zone, you might have to pay a part of the bill yourself, which is called co-payment. The percentage of co-payment can vary according to your policy.', 'Full Coverage: No co-payment for treatment in a higher zone. You’re fully covered regardless of the treatment location.', 'High Financial Risk: You may incur up to 10%–20% co-payment for treatment in a higher zone. While manageable, this portion can still be significant, especially for higher medical expenses.', 'Heavy Burden: You may have to pay up to 20%–35% co-payment, which could strain your finances significantly, especially for major medical treatments.', '2025-03-20 13:54:10', '2025-03-20 13:54:10'),
(8, 'consumcats', 'Consumables are the medical items used during treatment that cannot be reused. These include 120+ things like gloves, syringes, surgical masks, bandages, oxygen masks, and many other essentials.', 'Good news! Consumables like medical supplies, bandages, and surgical items are covered. You won’t need to pay extra for these, which could account for 15-20% of the total hospital bill.', 'Optional Coverage Available: Consumables like bandages, syringes, and IV fluids are not included in the base policy but can be covered by adding a rider for an additional premium. This ensures you won’t face out-of-pocket expenses for these, which can add up to 15-20% of the hospital bill.', 'Warning! Consumables such as medical supplies, bandages, and surgical items are not covered. You’ll need to pay for these yourself, and they can add up to 15-20% of the total hospital bill.', '2025-03-20 13:54:10', '2025-03-20 13:54:10'),
(9, 'comubonuscats', 'If you don’t make a claim, your insurer increases your sum insured every year. Some increase the sum insured by a fixed percentage, while others have a cap on how much bonus you can accumulate.', 'Excellent: The cumulative bonus ensures your sum insured doubles in just 2-3 years of claim-free policy terms. This rapid growth provides excellent protection for rising medical costs, giving you peace of mind at no extra cost.', 'Limited: The cumulative bonus adds some value to your sum insured but grows much slower compared to some other leading health insurance plans. It may take 6-10 years to double your coverage, compared to just 2-3 years in some better plans.', 'Poor: The cumulative bonus benefit is minimal or unavailable, making it difficult to grow your coverage meaningfully over time. You’ll have to rely on the original sum insured. There are better options that can double your coverage without any extra cost in just 2-3 years.', '2025-03-20 13:54:10', '2025-03-20 13:54:10'),
(10, 'domitreatcats', 'Sometimes, due to severe illness, lack of hospital beds, or a doctor\'s recommendation, a patient might need hospital-like care at home, which is called domiciliary treatment, and while many health insurance policies cover it, the terms and limits vary widely. Some insurers only cover specific illnesses under domiciliary treatment, while others have a cap on the amount they’ll pay.\r\n', 'Strength: Your policy fully covers domiciliary treatment, so you can receive medical care at home without worrying about extra costs. Insurance takes care of most expenses, minimizing your financial burden.', 'Lesser: Your policy covers domiciliary treatment but with conditions like specific illnesses, time limits, or a maximum coverage amount. You may have to bear some costs, and certain treatments might not be covered..', 'Below Par: Your policy either does not cover domiciliary treatment or provides very limited coverage. This means you may have to bear most or all of the costs if you need medical care at home, leading to a significant financial burden.', '2025-03-20 13:54:10', '2025-03-20 13:54:10'),
(11, 'GLOBAL COVER', 'Medical emergencies don’t wait for the right place or the right time. Whether you\'re travelling or living abroad, getting quality treatment is the most important thing. If your policy provides Global coverage, no matter where you are in the world for sudden illnesses to planned treatments, this feature gives you the best quality treatment without any financial stress. Just one thing to keep in mind is how much coverage your policy provides for this particular feature.', 'Strength: Your policy offers extensive global coverage, allowing you to access medical treatment abroad without worrying about high costs. This ensures financial security and the freedom to seek quality healthcare anywhere in the world.', 'Lesser: Your policy covers medical treatment abroad but may have restrictions such as limited coverage or coverage only for specific illnesses. You may need to bear some out-of-pocket costs, which could add to your overall medical expenses.', 'Below Par: Your policy either does not cover medical treatment outside your home country or provides very limited coverage. This means you may have to pay most or all of the costs if you need treatment abroad, leading to a significant financial burden.', '2025-03-20 13:54:10', '2025-03-20 13:54:10'),
(12, 'maternitycats', 'Bringing a baby into the world is magical, but the expenses? Not so much. Doctor visits, tests, delivery charges, every little thing adds up and when the bill comes, it hits the savings hard. But the maternity cover makes sure the medical bills don’t steal the happiness of holding your baby for the first time. But, you can’t claim the maternity cover right away. There are waiting periods and coverage limits on the policies.', 'Strength: Your policy provides sufficient maternity coverage, taking care of most or all delivery-related expenses, including hospital stays and necessary medical care. This reduces your financial burden and ensures a stress-free experience during pregnancy and childbirth.', 'Lesser: Your policy covers maternity expenses but may have restrictions such as a limited coverage, a waiting period, or limits on certain medical procedures. You may need to bear some out-of-pocket costs, which could add to your overall maternity expenses.', 'Below Par: Your policy either does not cover maternity expenses or provides very limited coverage. This means you may have to pay most or all of the costs for delivery and related medical care, leading to a significant financial burden.', '2025-03-20 13:54:10', '2025-03-20 13:54:10'),
(13, 'modtreatcats', 'Modern treatments are advanced medical procedures that use the latest technology to improve accuracy, reduce pain, and speed up recovery.', 'Optimal: Modern treatment procedures are well-covered, ensuring minimum risk of high out-of-pocket expenses.', 'Restricted: Coverage for modern treatments is limited, and you might face significant amount of the hospital bill for advanced procedures.', 'Warning: Modern treatments have major exclusions, potentially leaving you to pay a large portion of the bill yourself.', '2025-03-20 13:54:10', '2025-03-20 13:54:10'),
(14, 'newbornbabycovercats', 'Welcoming your baby into the world is priceless, but the medical bills that come with it aren’t. From hospital charges to the first vaccinations, even basic care can cost more than you expect. And in those first few weeks, when your baby needs the most attention, the last thing you should be worrying about is money. Newborn Baby Cover can help you with those unavoidable medical expenses but, they aren’t covered from day one.', 'Strength: Your policy offers good coverage for your newborn’s medical expenses, including hospitalization, vaccinations, and any critical care if required. This ensures financial security and access to proper medical care for your baby.', 'Lesser: Your policy provides coverage for newborn medical expenses but may have restrictions like limited coverage, exclusions for specific treatments, or a waiting period before the baby is covered. You may need to bear some out-of-pocket costs for your newborn.', 'Below Par: Your policy either does not cover newborn medical expenses or provides very limited coverage. This means you may have to pay most or all of the costs for your baby’s hospital care and medical needs, leading to a significant financial burden.', '2025-03-20 13:54:10', '2025-03-20 13:54:10'),
(15, 'posthospicats', 'If you have a health insurance plan which provides post-hospitalization coverage, then your insurer will take care of the medical expenses after you are discharged, as long as they’re related to the treatment you were hospitalized for.', 'Sufficient Cover (as per market standards): Your policy covers all the necessary medical expenses after you’re discharged from the hospital, including follow-up doctor visits, medications, and tests required for recovery. This ensures you have good support for your recovery after leaving the hospital.', 'Lesser: Your policy covers some of the post-hospitalization expenses, but the coverage may be limited. Certain follow-up treatments or medications might not be fully covered, which means you may need to pay for part of the costs out of your pocket.', 'Your policy offers very limited or no coverage for post-hospitalization expenses. This means you could be responsible for most of the costs for follow-up visits, medications, and treatments needed after your discharge.', '2025-03-20 13:54:10', '2025-03-20 13:54:10'),
(16, 'prehospicats', 'Pre-hospitalization provides the coverage of the medical costs directly linked to your hospitalization before you are admitted to the hospital for treatment, which includes expenses like doctor visits, medical tests, prescribed medicines and many more.', 'Your policy covers all the important costs related to the illness that leads to hospitalization. This includes doctor visits, tests, and medicines needed before you\'re admitted to the hospital.', 'Your policy provides coverage for some pre-hospitalization expenses, but the support may be limited, which could leave certain costs for consultations or tests uncovered.', 'Your policy offers minimal or no coverage for pre-hospitalization expenses, meaning you might have to bear most of these costs out of pocket.', '2025-03-20 13:54:10', '2025-03-20 13:54:10'),
(17, 'restobenecats', 'Running out of health insurance coverage in the middle of the year is a nightmare or a medical emergency. But if you have a restoration benefit, it will automatically refill your sum insured once it’s fully used up.', 'You’re fully covered. If your insured amount is exhausted, it will be restored without significant restrictions, ensuring you don’t have to worry about future hospitalizations within the same year.', 'Restricted: Restoration is available only in specific scenarios, significantly limiting its practical use and potentially resulting in high out-of-pocket expenses.', 'Warning: Restoration coverage is minimal or absent. Once your sum insured is used up, you may face substantial out-of-pocket expenses for any subsequent hospitalizations. This scenario indicates high financial risk without significant restoration options.', '2025-03-20 13:54:10', '2025-03-20 13:54:10'),
(18, 'roomrentcats', 'Room rent in health insurance simply means the cost of the hospital room per day, whose coverage limit your policy decides.', 'The hospital room covered by your health insurance will be suitable and comfortable for your treatment, so you don’t need to worry about paying extra.', 'Your insurance covers room costs up to a certain limit. Choosing a higher price room may mean paying a significant amount out of pocket, not just for the extra room charges but also for other hospital expenses like doctor fees, procedure costs, etc.', 'The hospital room covered by your health insurance may have some major limitations. If you choose a higher room category, you may have to pay a large portion of the hospital bill yourself.', '2025-03-20 13:54:10', '2025-03-20 13:54:10'),
(19, 'tpacats', 'When you file a health insurance claim, you don’t deal directly with the insurance company. Instead, there’s a TPA (Third-Party Administrator) that processes your claim. It’s like a bridge between you, the hospital, and your insurer.', 'Faster and Reliable: Managed directly by the insurer, internal TPAs ensure quicker claim approvals and personalized customer support. \r', 'Slower and Variable: External TPAs, managed by third-party companies, often involve additional coordination, which can lead to longer claim processing times. Service quality may vary depending on the TPA\'s efficiency, potentially affecting your overall experience.', '', '2025-03-20 13:54:10', '2025-03-20 13:54:10');
